import Vue from 'vue'
import VueRouter from 'vue-router'
import About from "../views/AboutView.vue";
Vue.use(VueRouter)

const routes = [
  {
    path: '/about',
    name: 'about',
    component: About
  }
]

const router = new VueRouter({
  routes
})

export default router
